import {
    useParams,
    Link
} from "react-router-dom";
import {UseChargetpoint,UseDeleteChargetpoint} from "../../../hooks/api/index";
import { usePages } from "../../../hooks/usePages/Usepages";
import { editchargetpointof,organizationList} from '../../../constants/urls';                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                              
import Organization from '../../Organization/list/Organizationlist';


export const Onechargetpoint = () => {
    
    const {id}= useParams();
    const chargetpoint = UseChargetpoint(id);
    const {gotolist}=usePages();
    const DeleteChargetpoint = UseDeleteChargetpoint(id);

    const handledelete = (id) =>{
        DeleteChargetpoint(id).then(response => gotolist())
    }
    return(
        <div className="xs100 just_center">
            <div className="flex_dir_col centrado mt20">
                <div className="flex ali_center mb20">
                <h1 className="pl20 size30 font">Identify:</h1>
                <p className="pl20 size20 font">{organization.name}</p>
                </div>
                <div className="flex ali_center font mb20">
                <h1 className="pl20 size30 font">Legalentity:</h1>
                <p className="pl20 size20">{chargetpoint.identify}</p>
                </div>
            <div>
                <button className="xs20 font" onClick={handledelete}>Delete</button>
                <Link className="xs20" to={editchargetpointof(id)}>
                <button className="xs20 font">Edit</button>
                </Link>
            </div>
            
           
            </div>
        </div>

       
        )
}
